import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="header-bar">
        <nav>
          <a href="/">HOME</a>
          <a href="/day1-ap-tg">DAY 1 AP TG</a>
        </nav>
      </header>
      <main>
        <div className="image-container">
          <img 
            src="https://pbs.twimg.com/media/GeghShrbEAA2-Oz?format=jpg&name=900x900" 
            alt="Telugu Box Office" 
          />
        </div>
      </main>
    </div>
  );
}

export default App;
